import React from "react";
import Navigation from "./Navigation";

const Transition = () => {
  return (
    <div className="rectangle">
      <div className="police">
        <h1> Dévouvrez leur profile et témoignage</h1>
        <div className="bg">
          <Navigation />
        </div>
      </div>
    </div>
  );
};

export default Transition;
